import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  padding: 20px;
  max-width: 1200px;
  margin: auto;
`;

const TextArea = styled.textarea`
  width: 100%;
  height: 100px;
  margin-top: 10px;
  padding: 10px;
  border: 1px solid ${({ theme }) => theme.border};
  border-radius: 5px;
  resize: none;
`;

const Button = styled.button`
  padding: 10px 20px;
  margin-top: 20px;
  background-color: ${({ theme }) => theme.buttonBackground};
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  &:hover {
    background-color: ${({ theme }) => theme.buttonHoverBackground};
  }
`;

const QuestionListPage: React.FC = () => {
  return (
    <Container>
      <h1>나의 포트폴리오</h1>
      <p>저는 1녀1남의 막내로 태어나 화목한 가정에서...</p>
      <h3>예상 면접 질문</h3>
      <ol>
        <li>당신은 막내로서 어떤 역할을 주로 수행했나요?</li>
        <li>화목한 가정은 어떻게 만들어질까요?</li>
        <li>집에서 어떤 심부름 해보셨어요?</li>
        <li>막내는 사랑을 많이 받나요?</li>
      </ol>
      <TextArea placeholder="여기에 질문에 답을 적어주세요..." />
      <Button>보내기</Button>
    </Container>
  );
};

export default QuestionListPage;
